import React from 'react'
import { SliderData } from './Data'

const ImageSlider = () => {
    return (
        <>
            {SliderData.map((slide, index) => {
                return(
                    <img src={slide.image}/>
                )
            })}
        </>
    )
}

export default ImageSlider
